import React, { Component } from 'react';
import Navbar from './Components/Navbar/navbar';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
         <Navbar/>
         <h1></h1>
        </header>
      </div>
    );
  }
}

export default App;
